import props from "../data/data"
import RealEstat from "./real-estat"
const Home = () => (
    <div className="proportes">{
        
    props.map(item=>{
        return(
            <div className="item" >
        <RealEstat key={item.id} item={item}></RealEstat>
           

           </div>
            )
    })}
     <style jsx>{`
                
                .proportes{
                    display: flex;
                    flex-direction: row;
                    flex-wrap: wrap;
                    justify-content: space-around;
                    max-height: 70vh;
                    overflow-y: scroll;
                }

                .item{
                   max-width: 46%;
                    margin-left: 2%;
                  }
                
                ` }
                
            </style>
    </div>
)

   
  export default Home;
